import React from 'react';
import {Box, Heading, ModalOverlay, VStack} from "@chakra-ui/react";

const NewQuestionDialog = () => {
    return (
        <>
            <Box zIndex={1000}
                 bg={'gray.100'}
                 opacity={.5}
                 position={'fixed'}
                 right={0}
                 top={0}
                 minW={'100vw'}
                 minH={'100vh'}/>
            <Box zIndex={1001}
                 position={'fixed'}
                 right={'50%'}
                 top={'30%'}
                 transform={"translate(50%,-50%)"}
            >
                <VStack>
                    <Heading>Add question</Heading>
                </VStack>
            </Box>
        </>
    );
};

export default NewQuestionDialog;
